        <title>Home Page</title>
        <style>
            @media only screen and (prefers-color-scheme: light) {
                :root {
                    --bg: #bbbbeb;
                    --fg: #232323;
                    --hl: #6666b6;
                    --tl: var(--hl);
                }
            }

            @media only screen and (prefers-color-scheme: dark) {
                :root {
                    --bg: #232323;
                    --fg: #bbbbeb;
                    --hl: #6666b6;
                    --tl: #ebeebb;
                }
            }

            html {
                margin: 0;
                padding: 0;
            }

            body {
                display: block;
                padding: 5em 15em;
                background-color: var(--bg);
                color: var(--fg);
                font-family: "Courier New", courier, monospace;
            }

            ul {
                list-style: none;
                margin-right: 3em;
                line-height: 1.5;
            }

            li:first-child {
                font-size: x-large;
                color: var(--hl);
            }

            a {
                text-decoration: none;
                color: var(--fg);
            }

            img {
                display: block;
                height: 400px;
                width: 200px;
                border: solid .15em var(--hl);
                object-fit: cover;
                position: absolute;
                right: 0;
            }

            input {
                position: absolute;
                bottom: -5em;
                left: 3em;
                width: 58%;
                height: 30px;
                border: none;
                border-radius: 3px;
                background: var(--fg);
                color: var(--bg);
                padding: 5px;
            }

            div, .links {
                display: flex;
                flex-direction: row;
                flex-wrap: wrap;
            }

            .links {
                max-width: 50vw;
            }

            nav {
                display: flex;
                flex-direction: column;
                position: relative;
            }

            h1 {
                display: block;
                margin: auto;
                color: var(--tl);
            }

            @media only screen and (max-width: 1200px) {
                div {
                    flex-direction: column;
                }

                img {
                    max-height: 350px;
                    bottom: 0;
                    right: -50px;
                }
            }

            @media only screen and (max-width: 820px) {
                body {
                    padding: 1em 0;
                }

                img {
                    display: none;
                }
            }
        </style>
